import { useSearchParams } from "react-router-dom";
import "./UserProfile.css"
import userprofile from "./userprofile.jpg"


function UserProfile(){
    const [email,setemail] =useState('');
    const [username,setusername] =useState('');
   const [phno,setphnumber] =useState('');
   const [hno,sethostelno] =useState('');
   const[roll ,setroll]=useState('');
   const[year,setyear]=useSearchParams


     

    return(
        <div className="div">
              <img src={userprofile} alt="" />
            <form action="">
                <label htmlFor="username">Username:</label>
                <input id="username"type="text" />
                <br />
                <label htmlFor="email">Email:</label>
                <input id="email"type="text" />
                <br />
                <label htmlFor="phno">Mob No.:</label>
                <input id="phno"type="number" />
                <br />
                <label htmlFor="hno">Hostel No.:</label>
                <input id="hno"type="number" />
                <br />
                <label htmlFor="roll">Roll No.:</label>
                <input id="roll"type="text" />
                <br />
                <label htmlFor="year">Year:</label>
                <input type="number" name="" id="" />
                <br />
                <label htmlFor="branch">Branch:</label>
                <input type="text"  id="branch" />

                

            </form>

        </div>
    );
}

export default UserProfile;
